var get_distance=function(){"use strict";function i(t,n){const a=t.lat*Math.PI/180,s=n.lat*Math.PI/180,h=(n.lng-t.lng)*Math.PI/180;return Math.acos(Math.sin(a)*Math.sin(s)+Math.cos(a)*Math.cos(s)*Math.cos(h))*6371e3}function d(t,n){const a=t.lat*Math.PI/180,s=n.lat*Math.PI/180,o=s-a,e=(n.lng-t.lng)*Math.PI/180,M=Math.sin(o/2)*Math.sin(o/2)+Math.cos(a)*Math.cos(s)*Math.sin(e/2)*Math.sin(e/2);return 2*Math.atan2(Math.sqrt(M),Math.sqrt(1-M))*6371e3}function l(t,n,c="cosine"){return c=="cosine"?d(t,n):i(t,n)}return l}();
